		return (
			<div className='search-bar ui segment '>
				<form className='ui form' onSubmit={this.onFormSubmit}>
					<div className='field'>
						<label>Search bar</label>
						<input
							type='text'
							value={this.state.term}
							onChange={e => {
                                console.l
								this.setState({ term: e.target.value });
							}}
						/>
